  waitFrames 1
  keyPress Up 1
  keyPress e 1
  waitFrames 2
  keyPress z 1
  keyPress e 1
  keyPress Left 1
  keyPress e 1
}

halberdEquip() {
	keyPress Escape 1
	keyPress e 1
	waitFrames 1
	keyPress Right 1
	keyPress e 1
	waitFrames 1
	keyPress Down 1
	keyPress e 1
	keyPress Escape 1
}

halberdUnequip() {
	keyPress Escape 1
	keyPress e 1
	waitFrames 1
	keyPress Right 1
	keyPress r 1
	keyPress Escape 1
}

waitForCompass() {
  while true; do
    if [[ $(echo $(grim -g "2160,520 1x1" - | hexdump)) = $(echo $(hexdump $REFERENCE_COMPASS)) ]]; then
      break
    fi
    usleep 500
  done
}

waitForNoCompass() {
  while true; do
    if [[ $(echo $(grim -g "2160,520 1x1" - | hexdump)) != $(echo $(hexdump $REFERENCE_COMPASS)) ]]; then
      break
    fi
    usleep 500
  done
}

waitForBlack() {
  while true; do
    if [[ $(echo $(grim -g "$(($SCREENX + $1)),$(($SCREENY + $2)) 1x1" - | hexdump)) = $(echo $(hexdump $REFERENCE_BLACK)) ]]; then
      break
    fi
    usleep 500
  done
}

waitForNoBlack() {
  while true; do
    if [[ $(echo $(grim -g "$(($SCREENX + $1)),$(($SCREENY + $2)) 1x1" - | hexdump)) != $(echo $(hexdump $REFERENCE_BLACK)) ]]; then
      break
    fi
    usleep 500
  done
}


